        caption:
          "Smooth Ride - Really love this bicycle! My husband and I went to the Target in Hastings, MN to look at bicycles and we both ended up getting the Schwinn Hybrid 28 inch. We had to come back and return his the same day, because the seat adjustment was defective, and was not able to be adjusted. But he loved the bicycle so much and wanted the same black Schwinn hybrid bike--but they didn't have any more of that model. The customer service associate, Cindi, went above and beyond for us, and found a store in Hudson, Wisconsin, that had the exact model and color. She called and made sure the seat was adjustable (it was!) and had them hold it for us. We picked it up an hour later. And now we are both very happy riders!",
