              "The Marshall hybrid electric bike by Schwinn is built for everyday adventures. Visit friends across town or just go exploring – you can do it all without worrying about long distances or steep hills. The Marshall features a 250-watt brushless geared hub drive pedal assist motor amplifies the effort you put into pedaling, up to 20 mph. Choose between several levels of assistance, or ride without it completely – you’re always in control. You can also use the throttle to accelerate without using the pedals, up to 20 MPH. The 288-watt hour internal downtube battery lasts for approximately 35 miles on a single charge, depending on conditions. Easily recharge in 4 hours with a standard household outlet and included charging cable. The battery also includes integrated LED lights that add to the sleek, modern look while helping others to see you on low light rides. Head and taillights are included for improved see and be-seen visibility. The Marshall also features an alloy frame for lightweight durability, 7-speed twist shifters, and mechanical disc brakes. Plus, 2.3-inch-wide wheels with alloy double wall rims offer superior durability without weighing you down. Like all Schwinn e-bikes, the Marshall comes with a 2-year warranty on the battery and electric assist parts, and a lifetime warranty on the frame and fork. Power up your adventure with the Marshall by Schwinn. <br /><br />There are a number of factors that impact how much weight a bicycle can withstand – including but not limited to the type of riding, road conditions, proper assembly, proper maintenance, how the weight of the rider and cargo is distributed, and tire inflation. The maximum weight limits for our bicycles are based on normal use conditions, proper assembly, and proper maintenance. ",
