        caption:
          "Fun to ride - I can't get over how awesome my Schwinn Adult Coston CE 27.5\" Step-Thru Hybrid Electric Bike is! This bike is heavy and very well made, everything about it from the comfy seat, to the metal frame, appear to be high quality. Out of the box, this electric bike was fairly easy to put together. It took me about an hour total, and included the tools needed to assemble it. It charges up quickly, and the charge lasts quite awhile. The pedals move nice and freely, and the brakes stop as they should. The headlight is nice and bright and illuminates the street nicely as I ride. I love the option I have of pedaling this bike, like a normal bike, or being able to switch the power on if I don't feel like pedaling up a hill, or I just get tired of pedaling altogether. I look forward to going on many bicycling adventures in the near future with my new bike.",
