                "The Coston DX comes with a 250-watt brushless geared hub-drive pedal assist motor that can accelerate up to 20mph",
                "Choose between several levels of assistance with the use of the throttle, without using the pedals, to move up to 20 mph",
                "The integrated downtube (360 watt) battery can last up to 45 miles on a single charge (depending on conditions); battery recharges in 5 hours with the charging cable (included)",
                "7-speed trigger shifter offers smooth gear changes, and mechanical disc brakes deliver all weather stopping power",
                "Head and taillights help the rider see and be seen in low light conditions; battery also features sleek integrated LED lights",
                "Alloy double wall rims equipped with 2.6&quot; wide tires provide great stability; full coverage fenders help keep the rider clean; rear rack to carry extra cargo",
